import MyComponent from './components/ViewPoliticas'; // Import your component
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  // Define an array of items
  const items = [
    { name: 'Item 1', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 2', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 3', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 4', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 5', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 6', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 7', des:'hola', dia:'hoy', color:'' },
    { name: 'Item 8', des:'hola', dia:'hoy', color:'' },
    // Add more items as needed
  ];

  return (
    <div >
      <h1>Politicas</h1>
      {/* Render your MyComponent and pass the 'items' array as props */}
      <div className ="">
        <MyComponent items={items} />
      </div>
    </div>
  );
}

export default App;
